    setShowDealer(!showDealer);
  }
  return (
    <div class="container">
      <div class="imageHolder">
        <img src="MFS.png" alt="logo" width="174px" height="33px" />
        <Separator />
        <div class="auctionSales"><text>Auction Sales Platform </text></div>
      </div>

